import React from 'react';
import axios from 'axios';
import Outputters from './Outputters.js';
import './cisco-atomic-ui.scss';
import Table from './Table.js';
import { Output } from './Output.js';

class Form extends React.Component {

  constructor(props) {
    super(props);
    this.state = {value: '', configData: []};
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event) {    this.setState({file: event.target.files[0]});  }

  handleSubmit(event) {
    const formData = new FormData();
    formData.append("file", this.state.file);
    try {
      axios({
        method: "post",
        url: "/api/uploadfile/",
        data: formData,
        headers: { "Content-Type": "multipart/form-data", "Access-Control-Allow-Origin": "*", "content": "application/json"},
      });
    } catch(error) {
      console.log(error)
    }
    alert('A name was submitted: ' + this.state.file);
    event.preventDefault();
  }

  render() {
    const rows = this.props.data.outputs.map((output) => {
      return <Output key={output.id} output={output}/>;
    });
    return (
      <body class="atomic-ui-root">
        <div class="banner">
          <div class="form-group">
            <form onSubmit={this.handleSubmit}>
              <div class="form-group__text">
                <label class="label">
                  FMC URL:
                <input id="fmcUrl" type="text" class="input" name="fmcUrl" placeholder={this.props.data.host} />
                </label>
              </div>
              <div class="form-group__text">
                <label class="label">
                  FMC Certificate:    
                  <input type="file" onChange={this.handleChange} />
                </label>
              </div>
              <div class="form-group__text">
                <label class="label">
                  AWS S3 Bucket: 
                <input id="awsBucket" type="text" class="input" name="aws_bucket" placeholder={this.props.data.s3} />
                </label>
              </div>
              <div class="form-group__text">
                <label class="label">
                  AWS Account: 
                  <input id="awsAccount" type="text" class="input" name="aws_account" placeholder={this.props.data.accountId}/>
                </label>
              </div>
              <div class="form-group__text">
                <label class="label">
                  AWS Region:  {this.props.data.region}
                <input id="awsRegion" type="text" class="input" name="aws_region" placeholder={this.props.data.region}/>
                </label>
              </div>
              <label class="switch">
                <input class="switch__input" type="checkbox" name="connections" checked=""/>
                  <span class="switch__box"></span>
                  <span class="switch__label">Enable Connection Events?</span>
              </label>  
              <input type="submit" class="btn btn--primary" value="Submit" />
            </form>
          </div>
          <div>
            <div class="col-md-12">
              <div class="panel">
                <div class="table-admins">
                  <h3>Output Types</h3>
                  <table class="table">
                    <thead>
                      <tr class="table__header-row">
                        <th class="table__header-cell">Output Type</th>
                        <th class="table__header-cell">Destination</th>
                        <th class="table__header-cell table__header-cell--align-center">Active</th>
                        <th class="table__header-cell table__header-cell--align-right">Last Data Sent</th>
                        <th class="table__header-cell table__header-cell--align-right">Action</th>
                      </tr>
                    </thead>
                     <tbody>
                       {rows}
                     </tbody>
                   </table>
                </div>
              </div>
            </div>
          </div>
        </div>
      </body>
    );
  }
}

export default Form;
